import Layout from "../components/Layout";

import { Grid } from "@material-ui/core";

const About = () => (
  <Layout>
    <Grid container>
      <Grid item lg={2}></Grid>
      <Grid item lg={8}>
        <div style={{ marginTop: 60 }}>About Tracthon</div>
      </Grid>
      <Grid item lg={2}></Grid>
    </Grid>

    <div style={{ marginTop: 60 }}>About Tracthon</div>
  </Layout>
);

export default About;
